import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import Button from 'react-bootstrap/Button'
import './Messages.css';


class AMessages extends React.Component{
	constructor(){
		super();
		this.state = {

		}
	}

	render(){
		return(
			<div>

				<h4>Requests</h4>
				<ListGroup horizontal id='size'>
				  <ListGroup.Item>Noah Menikefs has requested vacation from May 15, 2020 --> May 20, 2020
				  	<Button variant="success">Accept</Button>
				  	<Button variant="danger">Deny</Button>
				  </ListGroup.Item>
				  <ListGroup.Item>1 week ago</ListGroup.Item>
				</ListGroup>


			</div>

		);



	}


}

export default AMessages;
